@import '../../css/element.scss';
.panel{
    @include panel;
    >h4{
        border-bottom: 1px solid #ddd;
    }
    .content{
        @include flex;
        .item{
            @include flex(row);
            align-content: center;
            height: 140px;
            &::after{
                content: '';
                box-sizing: border-box;
                height: 0;
                width: 100%;
                border-bottom: 1px solid #ddd;
                margin-left: 150px;
                margin-top: 10px;
            }
            &:last-child::after{
                border-color: #fff;
            }
            >img{
                width: 88px;
                height: 88px;
                display: inline-block;
                margin: 0 32px;
            }
            >div{
                font-size: 32px;
                color: #333;
                line-height: 1.8;
                width: 344px;
                p{
                    color: #ff3232;
                    font-size: 24px;
                    line-height: 1.1;
                    white-space: nowrap;
                    text-overflow: ellipsis;
                    overflow: hidden;
                }
            }
            >em{
                color: #ff801a;
                font-size: 28px;
            }
        }
    }
}
